import styled from "styled-components"

const Header = styled.div`
    color:white;
    font-size:1.2em;
    display:flex;
    flex-direction:row;
    align-items:center;
    width:100%;
    background-color:#448487;
    padding:10px 0;
    position:fixed;
    padding:5px 80px;
    justify-content:center;
    .navigation{
        display:flex;
    }

`
export default Header
